import React from "react";
import Box from '@mui/material/Box';
import zIndex from "@mui/material/styles/zIndex";
import Avatar from '@mui/material/Avatar';
import Typography from '@mui/material/Typography';
import { border, textAlign } from "@mui/system";
import TextField from '@mui/material/TextField';
import Button from '@mui/material/Button';


function RedBar() {
    return (
      <Box
        sx={{
          height: 3
        }}
      />
    );
  }

function Signup(){

    return(


             <Box sx={{
                 top: 166,
                 left: 658,
                 width: 450,
                 height: 480,
                 background: '#FFFFFF 0% 0% no-repeat padding-box',
                 boxShadow: '0px 5px 15px #00000029',
                 border: '1px solid #E4E4E4',

                 opacity: 1,
                 zIndex:4,
                 display:'flex',
                 flexDirection:'column'
                 }}>
                     <Box sx={{
                         position:'relative',
                         top: 5,
                         left:50,
                         width: '40%',
                         height: 33,
                         textAlign: 'left',
                         font: 'normal normal medium 25px/33px Roboto',
                         letterSpacing: 0,
                         color: '#0A0102',
                         textTransform:'uppercase',
                         opacity: 1,
                         display:'flex',
                         flexDirection:'row',
                         justifyContent:'space-around'


                     }}><h2>SIGNUP</h2>
                        <h2 sx={{
                            position:'relative',
                            left:'300px'

                        }}>LOGIN</h2>

                     </Box>
                     <Box
                        sx={{
                            display: "flex",
                            flexDirection: "column",
                            "& .MuiTextField-root": { width: "30ch" },
                            position:'relative',
                            left:35,
                            top:30
                        }}
                        >
                        <RedBar />
                        <TextField label={'Full-Name"'} id="margin-none"  helperText="enter full name"/>
                        <RedBar />
                        <TextField label={'Email Id'} id="margin-none"  helperText="enter email id"/>
                        <RedBar />
                        <TextField label={'Password'} id="margin-normal"  helperText="password"/>
                        <RedBar />
                        <TextField label={'Mobile Number'} id="margin-normal" helperText="mobile" />

                        <Button variant="contained"  style={{position:'relative',background: '#A03037 0% 0% no-repeat padding-box', width:270}}
                         >Login</Button>



                     </Box>





             </Box>


    )

}
export default Signup
